import {
  DetailsCardDescr,
  DetailsCardSubTitle,
  DetailsCardTitle,
  DetailsCardWrapper,
} from "./DetailsCard.styled";
import { DetailsCardImage } from "./DetailsCardImage/DetailsCardImage";

export const DetailsCard = ({ data }) => {
  return (
    <DetailsCardWrapper>
      <DetailsCardImage image={data.profile_path} />

      <div>
        <DetailsCardTitle>{data.original_title}</DetailsCardTitle>
        <DetailsCardSubTitle>
          Rating: {Math.round(data.vote_average)}
        </DetailsCardSubTitle>
        <DetailsCardSubTitle>Overview</DetailsCardSubTitle>
        <DetailsCardDescr>{data.overview}</DetailsCardDescr>
        <DetailsCardSubTitle>Genres</DetailsCardSubTitle>
      </div>
    </DetailsCardWrapper>
  );
};
